import {Link} from 'react-router-dom'
import UserDetails from '../UserDetails';


const UserData=()=> {
  let stringifiedData = localStorage.getItem("userlist");
  let parsedData = JSON.parse(stringifiedData);
  if (parsedData.length===null){
      parsedData=[]
  }
  let showList=parsedData === null?false:true;
  console.log(parsedData)
  return (
    <div>
      <ul>
       <li className="list-item">
           <p className="name">Name</p>
           <p className="email">Email</p>
           <p className="age">Age</p>
           <hr className='line'/>
       </li>
       {showList && parsedData.map((each)=>(<UserDetails userlist={each} key={each.id}/>))}
      </ul>
      <Link to="/login"><button>Create</button></Link>
    </div>
  )
}

export default UserData
